import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the cart element using text selector (unique "Cart" text)
    const cartSelector = 'text=/\\d+\\s*Cart/';
    await page.waitForSelector(cartSelector, { timeout: 5000 });

    // Take screenshot before clicking cart
    const step2 = path.join(screenshotsDir, 'step_2_cart_visible.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the cart element to open the cart modal
    const cartElement = await page.$(cartSelector);
    await cartElement.click();

    // Wait for the cart modal to appear (look for modal with cart content)
    // Try to wait for a heading or text inside the modal
    let modalSelector = '.modal[style*="display: block"]';
    let modalVisible = false;
    try {
      await page.waitForSelector(modalSelector, { timeout: 2000 });
      modalVisible = true;
    } catch {
      // Fallback: Wait for a heading inside modal (e.g., "Your cart is empty" or "Cart")
      modalSelector = 'text=/Your cart is empty|Cart/i';
      await page.waitForSelector(modalSelector, { timeout: 3000 });
      modalVisible = true;
    }

    // Take screenshot after opening cart modal
    const step3 = path.join(screenshotsDir, 'step_3_cart_modal_open.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart modal content for verification
    let cartModalText = '';
    if (modalVisible) {
      const modalHandle = await page.$(modalSelector);
      if (modalHandle) {
        cartModalText = await modalHandle.innerText();
      }
    }

    return {
      success: true,
      action: "Opened the Shopping Cart Modal and verified its appearance",
      extractedData: {
        cartModalText: cartModalText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
